// StudentList.tsx

import React from 'react';

interface Student {
  _id: string;
  name: string;
  email: string;
  learningStyle: string[]; // Asegúrate de definir learningStyle como un array de strings
}

interface StudentListProps {
  students: Student[];
  onDelete: (studentId: string) => void;
}

const StudentList: React.FC<StudentListProps> = ({ students, onDelete }) => {
  return (
    <div>
      <h1>Student List</h1>
      {students.map((student) => (
        <div key={student._id}>
          <h2>{student.name}</h2>
          <p>Email: {student.email}</p>
          <p>Learning Style: {student.learningStyle.join(', ')}</p> {/* Aquí se usa join porque learningStyle es un array de strings */}
          <button onClick={() => onDelete(student._id)}>Delete</button>
          <hr />
        </div>
      ))}
    </div>
  );
};

export default StudentList;
